// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract CopyrightToken is ERC721, Ownable {
  uint256 private _tokenIds;

  enum CopyrightStatus {
    Pending,
    Approved,
    Rejected
  }

  struct CopyrightInfo {
    string title;
    string description;
    string imageUrl;
    string category;
    uint256 registrationDate;
    CopyrightStatus status;
    string ipfsHash;
  }

  mapping(uint256 => CopyrightInfo) private _copyrightInfo;
  mapping(address => uint256[]) private _userCopyrights;
  mapping(uint256 => string) private _tokenURIs;

  event CopyrightRegistered(
    uint256 indexed tokenId,
    string title,
    string category,
    address owner,
    string ipfsHash
  );

  constructor() ERC721("CopyrightToken", "CPT") Ownable(msg.sender) {}

  function tokenURI(
    uint256 tokenId
  ) public view virtual override returns (string memory) {
    require(_ownerOf(tokenId) != address(0), "URI query for nonexistent token");
    return _tokenURIs[tokenId];
  }

  function registerCopyright(
    string memory title,
    string memory description,
    string memory imageUrl,
    string memory category,
    string memory ipfsHash
  ) public returns (uint256) {
    require(bytes(title).length > 0, "Title cannot be empty");
    require(bytes(description).length > 0, "Description cannot be empty");
    require(bytes(imageUrl).length > 0, "Image URL cannot be empty");
    require(bytes(category).length > 0, "Category cannot be empty");
    require(bytes(ipfsHash).length > 0, "IPFS hash cannot be empty");

    uint256 newTokenId = _tokenIds++;

    _safeMint(msg.sender, newTokenId);
    _tokenURIs[newTokenId] = ipfsHash;

    _copyrightInfo[newTokenId] = CopyrightInfo({
      title: title,
      description: description,
      imageUrl: imageUrl,
      category: category,
      registrationDate: block.timestamp,
      status: CopyrightStatus.Pending,
      ipfsHash: ipfsHash
    });

    emit CopyrightRegistered(newTokenId, title, category, msg.sender, ipfsHash);
    return newTokenId;
  }

  function getCopyrightInfo(
    uint256 tokenId
  )
    public
    view
    returns (
      string memory title,
      string memory description,
      string memory imageUrl,
      string memory category,
      uint256 registrationDate,
      string memory ipfsHash
    )
  {
    require(_ownerOf(tokenId) != address(0), "Token does not exist");
    CopyrightInfo memory info = _copyrightInfo[tokenId];
    return (
      info.title,
      info.description,
      info.imageUrl,
      info.category,
      info.registrationDate,
      info.ipfsHash
    );
  }
}
